import React from "react";

const Projectbookshelf = () => {
    return (
        <div>
            <div className="project-link"><a href="https://annaylin.com/blog/bookshelf/">View Project</a></div>
            <h2>About this project</h2>
            <div className="project-details">
                <p>Learning how to make <a title="Shirley Wu's course on Building Custom Data Visualizations"
                                           target="_blank"
                                           rel="noopener noreferrer"
                                           href="https://frontendmasters.com/courses/d3-js-custom-charts/">d3 charts in
                    Observable</a> at the moment, and using SVGs to build interactive websites with data.</p>
            </div>
        </div>
    );
};

export default Projectbookshelf;
